commands:
  SET_LED_STATE:
    name: SET_LED_STATE
    id: 0
    param_0: LED state
    param_1: LED state (duplicate)
    param_2: LED state (duplicate)
    param_3: LED state (duplicate)
    comment: Only the first led_state is used, the rest are duplication for testing
  SET_RTC_TIME:
    name: SET_RTC_TIME
    id: 1
    param_0: hour
    param_1: minute
    param_2: second
    param_3: UNUSED
    comment: pass in the hours, minutes, and seconds to set the RTC time. This is
      in 24 hour format
  SET_RTC_DATE:
    name: SET_RTC_DATE
    id: 2
    param_0: year
    param_1: month
    param_2: day
    param_3: weekday
    comment: pass in the year, month, date, and day of week to set the RTC date. Year
      is number of years since 1970. For weekday, mon = 1, teus = 2, ..., sun = 7
  SEND_BUCKET_PARAMS:
    name: SEND_BUCKET_PARAMS
    id: 3
    param_0: UNUSED
    param_1: UNUSED
    param_2: UNUSED
    param_3: UNUSED
    comment: Command to start the DLM-DAM initialization process
  SET_BUCKET_SIZE:
    name: SET_BUCKET_SIZE
    id: 4
    param_0: bucket ID
    param_1: number of parameters in that bucket
    param_2: UNUSED
    param_3: UNUSED
    comment: Sets the number of parameters in the bucket specified by the bucket ID
  ADD_PARAM_TO_BUCKET:
    name: ADD_PARAM_TO_BUCKET
    id: 5
    param_0: bucket ID
    param_1: parameter ID - most significan byte
    param_2: parameter ID - least significan byte
    param_3: UNUSED
    comment: Adds a specified parameter to the specified DLM bucket
  ASSIGN_BUCKET_TO_FRQ:
    name: ASSIGN_BUCKET_TO_FRQ
    id: 6
    param_0: bucket ID
    param_1: MS between requests - most significant byte
    param_2: MS between requests - least significant byte
    param_3: UNUSED
    comment: Sets the wait time between requests of this bucket in milliseconds. A
      value of 0 will stop requesting this bucket
  BUCKET_OK:
    name: BUCKET_OK
    id: 7
    param_0: bucket ID
    param_1: UNUSED
    param_2: UNUSED
    param_3: UNUSED
    comment: This command is sent when the bucket has the number of parameters it
      expects
  REQUEST_BUCKET:
    name: REQUEST_BUCKET
    id: 8
    param_0: bucket ID
    param_1: UNUSED
    param_2: UNUSED
    param_3: UNUSED
    comment: CAN command to send each parameter in the bucket
